  /* for input one (Ïñ¥Îñ§ Î¨∏Ï†úÏóê ÎåÄÌïú ÌîºÎìúÎ∞±?) */
  const inputOneRef = useRef();
  const [inputOneContent, setInputOneContent] = useState("");

  /* for input two (ÏÉÅÏÑ∏ ÎÇ¥Ïö©) */
  const inputTwoRef = useRef();
  const [inputTwoContent, setInputTwoContent] = useState("");

  /* for input four (Ïù¥Î©îÏùº Ï£ºÏÜåÎ•º ÏûÖÎ†•) */
  const inputFourRef = useRef();
  const [inputFourContent, setInputFourContent] = useState("");

  /* for submit button */
  const navigate = useNavigate();
  const [isValid, setIsValid] = useState(true);
  const handleSubmit = () => {
    var validRegex = /^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i;

    if (inputOneContent.length < 1) {
      inputOneRef.current.focus();
      return;
    }

    if (inputTwoContent.length < 1) {
      inputTwoRef.current.focus();
      return;
    }

    if (!validRegex.test(inputFourContent)) {
      inputFourRef.current.focus();
      setIsValid(false);
      return;
    }

    setIsValid(true);
    if (window.confirm("Ï†úÏ∂úÌïòÏãúÍ≤†ÏäµÎãàÍπå?")) {
      navigate("/", { replace: true }); // Î°úÍ∑∏Ïù∏ Îêú ÏÉÅÌÉúÏóêÏÑúÎßå ÌîºÎìúÎ∞±ÏùÑ Îì§Ïñ¥Í∞à Ïàò ÏûàÏúºÎØÄÎ°ú Ïù¥Îèô ÎßÅÌÅ¨Î•º Calendar.jsÎ°ú Î≥ÄÍ≤ΩÌï¥ÏïºÎêúÎã§.
    }
  };

  /* axios */
  // const axios = require("axios");
  axios.defaults.withCredentials = true;
  const data = {
    id: "sample",
    title: "error",
    contents: ",,,,,",
    email: "sk@sample.com",
    read_cnt: 0,
  };
  const headers = {};
  async function samplePost() {
    const response = await axios.post(
      "http://localhost:8080/feedback",
      data,
      headers
    );
    return response;
  }
  samplePost();
  // function componentDidMount() {
  //   axios.get("http://localhost:8080/feedback").then((response) => {
  //     console.log(response.data.length);
  //   });
  // }
  // componentDidMount();

  // function testAxios() {
