  return (
    <div className="Feedback">
      <MyHeader
        btn1Type="short"
        btn1Text="Feedback"
        btn1Func={() => navigator("/feedback")}
        btn2Type="short"
        btn2Text="sign In"
        btn2Func={(e) => alert("sign clicked")}
      />
      <div className="main_wrapper">
        <div className="main">
          <div className="comment">
            <h1 className="h1">FeedBack</h1>
            <p className="caption">
              Í∑ÄÌïòÏùò Í∑ÄÏ§ëÌïú ÏùòÍ≤¨ÏùÑ Îì§Î†§Ï£ºÏã≠ÏãúÏò§. Ïö∞Î¶¨Îäî Ïñ∏Ï†úÎÇò Ïó¨Îü¨Î∂ÑÏùò ÏùòÍ≤¨ÏùÑ
