                onChange={(e) => setInputFourContent(e.target.value)}
              />
            </div>
            <div className="myButton_wrapper">
              <MyButton
                text="Submit"
                type="long"
                onClick={handleSubmit}
              ></MyButton>
            </div>
          </div>
        </div>
      </div>
      <MyFooter></MyFooter>
    </div>
  );
};

export default Feedback;
